import React from "react";
import { vehicles } from "../../../constants";

const Learn_Powertrain = (props) => {
  const { car } = props;
  const carSlides = vehicles.find(
    (vehicle) => vehicle.model === car.model
  ).slides;
  if (car.powerTrain) {
    return (
      <section>
        <h2>Electric Powertrain</h2>
        <p></p>
      </section>
    );
  }
};

export default Learn_Powertrain;
